import React from 'react';
function Home(){
    return(
        <div class="home">
           <p>Science, also widely referred to as 
               Science Magazine, is the peer-reviewed academic journal of the American Association for the Advancement of Science and one of the world's top academic journals. It was first published in 1880, is currently circulated weekly and has a subscriber base of around 130,000. Because institutional subscriptions and online access serve a larger audience, its estimated readership is 570,400 people.</p></div>
    );
}
export default Home;
